import React from 'react';


const PostStamp = (props) => {
    return (
        <img 
            src="http://www.html5rocks.com/en/tutorials/masking/adobe/humayun-thom-arno.jpg" 
            className="postStamp"
            width="160rem"
            height="120rem"
        />
    );

}


export default PostStamp;
